export class CustomValidators {
  static invalidProjectName(control) {
    if (control.value === "Test") {
      return {
        invalidProjectName: true
      };
    }
    return null;
  }
  static asyncInvalidProjectName(control) {
    const promise = new Promise((resolve, reject) => {
      setTimeout(() => {
        if (control.value === "Test") {
          resolve({
            invalidProjectName: true
          });
        } else {
          resolve(null);
        }
      }, 2000);
    });
  }
}
